\u0075\u0073\u0069\u006e\u0067 \u0055\u006e\u0069\u0074\u0079\u0045\u006e\u0067\u0069\u006e\u0065;\u0075\u0073\u0069\u006e\u0067 \u0053\u0079\u0073\u0074\u0065\u006d.\u0043\u006f\u006c\u006c\u0065\u0063\u0074\u0069\u006f\u006e\u0073;\u0075\u0073\u0069\u006e\u0067 \u0053\u0079\u0073\u0074\u0065\u006d.\u004c\u0069\u006e\u0071;\u006e\u0061\u006d\u0065\u0073\u0070\u0061\u0063\u0065 \u004f\u0078\u0069\u0064\u0065.\u0050\u006c\u0075\u0067\u0069\u006e\u0073{[\u0049\u006e\u0066\u006f("\u0049\u0073\u006c\u0061\u004e\u0075\u0062\u006c\u0061\u0072\u0050\u0072\u006f\u0074\u0065\u0063\u0074\u0069\u006f\u006e", "\u0045\u006c\u0065\u0063\u0074\u0072\u0069\u006b", "1.0.0")]\u0063\u006c\u0061\u0073\u0073 \u0049\u0073\u006c\u0061\u004e\u0075\u0062\u006c\u0061\u0072\u0050\u0072\u006f\u0074\u0065\u0063\u0074\u0069\u006f\u006e : \u0052\u0075\u0073\u0074\u0050\u006c\u0075\u0067\u0069\u006e{\u0076\u006f\u0069\u0064 \u004f\u006e\u0057\u006f\u0072\u006c\u0064\u0050\u0072\u0065\u0066\u0061\u0062\u0053\u0070\u0061\u0077\u006e\u0065\u0064(\u0047\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074 \u0067\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074, \u0073\u0074\u0072\u0069\u006e\u0067 \u0063\u0061\u0074\u0065\u0067\u006f\u0072\u0079){\u0069\u0066 (\u0067\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074.\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d.\u006c\u006f\u0063\u0061\u006c\u0053\u0063\u0061\u006c\u0065.\u0079 == 0 && \u0067\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074.\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d.\u006c\u006f\u0063\u0061\u006c\u0053\u0063\u0061\u006c\u0065.\u0078 == 0)\u0047\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074.\u0044\u0065\u0073\u0074\u0072\u006f\u0079(\u0067\u0061\u006d\u0065\u004f\u0062\u006a\u0065\u0063\u0074);}\u0076\u006f\u0069\u0064 \u004f\u006e\u0053\u0065\u0072\u0076\u0065\u0072\u0049\u006e\u0069\u0074\u0069\u0061\u006c\u0069\u007a\u0065\u0064(){\u0066\u006f\u0072\u0065\u0061\u0063\u0068 (\u0076\u0061\u0072 \u0065\u006e\u0074\u0072\u0079 \u0069\u006e \u0042\u0061\u0073\u0065\u004e\u0065\u0074\u0077\u006f\u0072\u006b\u0061\u0062\u006c\u0065.\u0073\u0065\u0072\u0076\u0065\u0072\u0045\u006e\u0074\u0069\u0074\u0069\u0065\u0073.\u0054\u006f\u004c\u0069\u0073\u0074()){\u0069\u0066 (\u0065\u006e\u0074\u0072\u0079.\u0074\u0072\u0061\u006e\u0073\u0066\u006f\u0072\u006d.\u006c\u006f\u0063\u0061\u006c\u0053\u0063\u0061\u006c\u0065.\u0079 == 200)\u0065\u006e\u0074\u0072\u0079.\u004b\u0069\u006c\u006c();}\u0053\u0065\u0072\u0076\u0065\u0072.\u0043\u006f\u006d\u006d\u0061\u006e\u0064("\u006f.\u0075\u006e\u006c\u006f\u0061\u0064 \u0049\u0073\u006c\u0061\u004e\u0075\u0062\u006c\u0061\u0072\u0050\u0072\u006f\u0074\u0065\u0063\u0074\u0069\u006f\u006e");}}}